Règles de gestion:
La catégorie de transaction doit être codifiée selon la liste suivante : 
TLB1 : Livraisons de biens soumises à la taxe sur la valeur ajoutée ; 
TPS1 : Prestations de services soumises à la taxe sur la valeur ajoutée ;
TNT1 : Livraisons de biens et prestations de services non soumises à la taxe sur la valeur ajoutée en France dont les ventes à distance intracommunautaires mentionnées au 1° du I de l’article 258 A et à l’article 259 B du code général des impôts ;
TMA1 : Opérations donnant lieu à l'application des régimes prévus au e) du 1 de l'article 266 et aux articles 268 et 297 A du CGI  (régime de TVA sur la marge).

Le code montant (MDT-207) est à choisir dans la liste suivante :
- RAP : Reste à payer (en cas de paiement partiel);
- ESC : Escompte accordé ;
- RAB : Rabais accordé ;
- REM : Remise accordée.

- MPA : Montant payé
- MEN : Montant encaissé (TTC)

Le flux doit être nommé selon la convention suivante :
•	un code interface qui permet d’identifier la nature du flux et son format (8 caractères, voir Dossier général des spécifications externes du PPF) ;
•	un code application partenaire de l’émetteur destinataire du flux  (6 caractères) ; 
•	un identifiant de flux (25 caractères) construit à partir du code application de l’émetteur du flux (6 premiers caractères) et d’un numéro de séquence (19 caractères : chiffres ou lettres majuscules).

